export const supportedLocales=["en_us","es_us","fr_us","en","es","fr","it","de","nl","jp","ch","ch_tw","ch_zh","kr"];export const weakLocales=["jp","ch","ch_tw","ch_zh","kr","de","nl"];let e=[["en_us","USen"],["es_us","USes"],["fr_us","USfr"],["en","EUen"],["es","EUes"],["fr","EUfr"],["it","EUit"],["de","EUde"],["nl","EUnl"],["jp","JPja"],["ch","CNzh"],["ch_tw","TWzh"],["ch_zh","CNzh"],["kr","KRko"]];export function guessLocale(s){return e.find(e=>e.find(e=>e===s))?.[0]}export function simplifyLocales(e){let s=new Set;for(let t of e)if(t.endsWith("_us")){let[n]=t.split("_",2);e.includes(n)||s.add(t)}else s.add(t);return[...s]}